(1, 'Wcc1H.56505461_278603399739896_2379261528063868928_o.jpg', 'عن اللعبة', 'اعتراف هي لعبة كتابية جماعية ممتعة تطلب مجموعة من ٣ اصدقاء او اكثر لبدآ لعبة ويتم فيها توجية اسئلة من احد الاعبين الي لاعب اخر في نفس المجموعة. وبعد ان يقوم اللاعب بالاجابة يجب عليه ان يختار لاعب اخر لتوجية سؤال جديد له.<br>لعبة اعتراف هي امتداد للالعاب القديمة المعروفة مثل: ”كرسي الاعتراف“، ”الحقيقة والجرآة“، و ”لعبة الزجاجة الدوارة“.<br>في لعبة اعتراف يجب انشاء مجموعة ثم اضافة او دعوه ثلاث اصدقاء علي الاقل للمجموعة لتبدآ اللعبة.<br>يمكنك انشاء اما مجموعة خاصة او عامة. فالمجموعة الخاصة لا تظهر الاسئلة والاجابات فيها الا لاعضاء المجموعة. اما المجموعة العامة يظهر محتواها للجميع ولا يستطيع المشاركة بالاسئلة والاجابة الا الاعضاء فقط.<br>انشئ مجموعة واعطها اسم مميز وصورة مميزة وادعوا اصدقائك وآبدآ اللعب الان.', '0', '1', '2019-03-24 12:14:50', '2019-04-18 20:37:36'),
(2, 'xqp7Y.1 (23).png', 'الشروط والسياسات', 'اعتراف هي لعبة كتابية جماعية ممتعة تطلب مجموعة من ٣ اصدقاء او اكثر لبدآ لعبة ويتم فيها توجية اسئلة من احد الاعبين الي لاعب اخر في نفس المجموعة. وبعد ان يقوم اللاعب بالاجابة يجب عليه ان يختار لاعب اخر لتوجية سؤال جديد له.<br>لعبة اعتراف هي امتداد للالعاب القديمة المعروفة مثل: ”كرسي الاعتراف“، ”الحقيقة والجرآة“، و ”لعبة الزجاجة الدوارة“.<br>في لعبة اعتراف يجب انشاء مجموعة ثم اضافة او دعوه ثلاث اصدقاء علي الاقل للمجموعة لتبدآ اللعبة.<br>يمكنك انشاء اما مجموعة خاصة او عامة. فالمجموعة الخاصة لا تظهر الاسئلة والاجابات فيها الا لاعضاء المجموعة. اما المجموعة العامة يظهر محتواها للجميع ولا يستطيع المشاركة بالاسئلة والاجابة الا الاعضاء فقط.<br>انشئ مجموعة واعطها اسم مميز وصورة مميزة وادعوا اصدقائك وآبدآ اللعب الان.', '0', '1', '2019-04-16 08:46:35', '2019-04-18 19:43:57');
