INSERT INTO `site` (`id`, `title`, `desc`, `footer`, `tags`, `email`, `phone`, `mobile`, `fax`, `facebook`, `twitter`, `whatsapp`, `youtube`, `instagram`, `snapchat`, `android`, `ios`, `logo`, `lat`, `lng`, `doneby`, `created_at`, `updated_at`) VALUES
(1, 'اعتراف - العب مع اصحابك', '<div align=\"center\"><span style=\"font-size: 14px;\">اعتراف هي لعبة كتابية\r\n جماعية ممتعة تطلب مجموعة من ٣ اصدقاء او اكثر لبدآ لعبة ويتم فيها توجية \r\nاسئلة من احد الاعبين الي لاعب اخر في نفس المجموعة. وبعد ان يقوم اللاعب \r\nبالاجابة يجب عليه ان يختار لاعب اخر لتوجية سؤال جديد له.</span><br><span style=\"font-size: 14px;\">لعبة اعتراف هي امتداد للالعاب القديمة المعروفة مثل: ”كرسي الاعتراف“، ”الحقيقة والجرآة“، و ”لعبة الزجاجة الدوارة“.</span><br><span style=\"font-size: 14px;\">في لعبة اعتراف يجب انشاء مجموعة ثم اضافة او دعوه ثلاث اصدقاء علي الاقل للمجموعة لتبدآ اللعبة. وحتي تبدآ اللعبة يجب ان يقوم الادمن بطرح اول سؤال.</span><br><span style=\"font-size: 14px;\">يمكنك\r\n انشاء اما مجموعة خاصة او عامة. فالمجموعة الخاصة لا تظهر الاسئلة \r\nوالاجابات فيها الا لاعضاء المجموعة. اما المجموعة العامة يظهر محتواها \r\nللجميع ولا يستطيع المشاركة بالاسئلة والاجابة الا الاعضاء فقط.</span><br><span style=\"font-size: 14px;\">انشئ مجموعة واعطها اسم مميز وصورة مميزة وادعوا اصدقائك وآبدآ اللعب الان.</span></div>', '<p>اعتراف هي لعبة كتابية جماعية ممتعة تطلب مجموعة من ٣ اصدقاء او اكثر لبدآ \r\nلعبة ويتم فيها توجية اسئلة من احد الاعبين الي لاعب اخر في نفس المجموعة. \r\nوبعد ان يقوم اللاعب بالاجابة يجب عليه ان يختار لاعب اخر لتوجية سؤال جديد\r\n له.</p><p>انشئ مجموعة واعطها اسم مميز وصورة مميزة وادعوا اصدقائك وآبدآ اللعب الان.</p>', 'الكلمات الدلالية', 'admin@eatraf.com', '+201000281662', '+201000281662', NULL, 'https://www.facebook.com/EatrafGame/', NULL, '+201000281662', NULL, 'https://www.instagram.com/eatrafgame/', NULL, NULL, NULL, '3eqw5.logo.png', '24.598411724742483', '46.7138671875', '47', NULL, '2019-04-18 21:38:55');
